import React, { useState, useEffect } from 'react';
import { DragDropContext, Droppable, Draggable } from 'react-beautiful-dnd';

const tabs = ['Genshin', 'HSR', 'Zenless', 'Others'];

const exampleData = {
  Genshin: [
    { id: '1', name: 'Sword of Dawn', price: 100, stats: 'Популярный меч' },
    { id: '2', name: 'Magic Wand', price: 150, stats: 'Магический посох' },
  ],
  HSR: [
    { id: '3', name: 'Shield of Twilight', price: 200, stats: 'Защищает от темных сил' },
  ],
  Zenless: [
    { id: '4', name: 'Zen Blade', price: 180, stats: 'Лезвие дзена' },
  ],
  Others: [
    { id: '5', name: 'Mystery Box', price: 50, stats: 'Случайные предметы' },
  ],
};

export default function ShopPage() {
  const [activeTab, setActiveTab] = useState(tabs[0]);
  const [items, setItems] = useState([]);

  useEffect(() => {
    setItems(exampleData[activeTab] || []);
  }, [activeTab]);

  const updatePrice = (id, newPrice) => {
    setItems(prevItems =>
      prevItems.map(item => (item.id === id ? { ...item, price: newPrice } : item))
    );
  };

  const handlePriceChange = (id, e) => {
    const value = e.target.value;
    if (/^\d*$/.test(value)) {
      updatePrice(id, value === '' ? '' : Number(value));
    }
  };

  // Обработчик окончания drag & drop
  const onDragEnd = (result) => {
    if (!result.destination) return;

    const reordered = Array.from(items);
    const [removed] = reordered.splice(result.source.index, 1);
    reordered.splice(result.destination.index, 0, removed);

    setItems(reordered);
  };

  return (
    <div>
      <h1>Магазин</h1>

      <div style={{ marginBottom: 20 }}>
        {tabs.map(tab => (
          <button
            key={tab}
            onClick={() => setActiveTab(tab)}
            style={{
              marginRight: 8,
              padding: '8px 16px',
              backgroundColor: activeTab === tab ? '#3498db' : '#ddd',
              color: activeTab === tab ? 'white' : 'black',
              border: 'none',
              borderRadius: 4,
              cursor: 'pointer',
            }}
          >
            {tab}
          </button>
        ))}
      </div>

      <DragDropContext onDragEnd={onDragEnd}>
        <Droppable droppableId="itemsTable">
          {(provided) => (
            <table
              {...provided.droppableProps}
              ref={provided.innerRef}
              style={{ width: '100%', borderCollapse: 'collapse' }}
            >
              <thead>
                <tr>
                  <th style={{ border: '1px solid #ccc', padding: 8 }}>ID</th>
                  <th style={{ border: '1px solid #ccc', padding: 8 }}>Название</th>
                  <th style={{ border: '1px solid #ccc', padding: 8 }}>Цена</th>
                  <th style={{ border: '1px solid #ccc', padding: 8 }}>Статистика</th>
                </tr>
              </thead>
              <tbody>
                {items.length === 0 && (
                  <tr>
                    <td colSpan="4" style={{ textAlign: 'center', padding: 20 }}>
                      Нет предметов в этой категории.
                    </td>
                  </tr>
                )}
                {items.map((item, index) => (
                  <Draggable key={item.id} draggableId={item.id} index={index}>
                    {(provided, snapshot) => (
                      <tr
                        ref={provided.innerRef}
                        {...provided.draggableProps}
                        {...provided.dragHandleProps}
                        style={{
                          ...provided.draggableProps.style,
                          backgroundColor: snapshot.isDragging ? '#f0f8ff' : 'inherit',
                          border: snapshot.isDragging ? '1px solid #3498db' : 'none',
                        }}
                      >
                        <td style={{ border: '1px solid #ccc', padding: 8 }}>{item.id}</td>
                        <td style={{ border: '1px solid #ccc', padding: 8 }}>{item.name}</td>
                        <td style={{ border: '1px solid #ccc', padding: 8 }}>
                          <input
                            type="text"
                            value={item.price}
                            onChange={(e) => handlePriceChange(item.id, e)}
                            style={{ width: '80px', padding: '4px' }}
                          />
                        </td>
                        <td style={{ border: '1px solid #ccc', padding: 8 }}>{item.stats}</td>
                      </tr>
                    )}
                  </Draggable>
                ))}
                {provided.placeholder}
              </tbody>
            </table>
          )}
        </Droppable>
      </DragDropContext>
    </div>
  );
}
